  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>wael Magdy - vCard</title>
  <style>
    body { font-family: 'Roboto', sans-serif; background: linear-gradient(to bottom, #5fc5b5, #4b79d8); margin: 0; padding: 0; color: #333; }
    .card { max-width: 420px; margin: 40px auto; border-radius: 12px; overflow: hidden; box-shadow: 0 8px 24px rgba(0,0,0,0.15); background: white; }
    .card-header { background: linear-gradient(to bottom, #5fc5b5, #4b79d8); color: white; text-align: center; padding: 30px 20px 20px; }
    .card-header img.profile { width: 100px; height: 100px; object-fit: cover; border-radius: 50%; border: 4px solid white; margin-bottom: 10px; }
    .card-header h2 { margin: 10px 0 5px; font-size: 22px; font-weight: 700; }
    .card-header h3 { margin: 0; font-size: 16px; font-weight: bold; }
    .contact-buttons { display: flex; justify-content: center; gap: 15px; margin-top: 15px; }
    .contact-buttons a { background: white; border-radius: 50%; width: 56px; height: 56px; display: flex; align-items: center; justify-content: center; box-shadow: 0 4px 8px rgba(0,0,0,0.1); }
    .contact-buttons img { width: 28px; height: 28px; }
    .info { background: white; padding: 20px; }
    .info p { margin: 10px 0; display: flex; align-items: center; }
    .info img.icon { width: 18px; height: 18px; margin-right: 8px; }
    .label { font-size: 12px; font-weight: bold; display: block; margin-bottom: 2px; }
    .qr { text-align: center; margin-top: 20px; }
    .download-btn { background: #4b79d8; color: white; padding: 10px 20px; border-radius: 8px; text-decoration: none; display: inline-block; margin-top: 15px; font-weight: bold; }
  </style>
